        return (
            <div>
                <form>
                    <input 
                    type="text"
                    name="username"
                    value=""
                    placeholder="Enter your username"/>
                    <br/>
                    <input 
                    type="password"
                    name="password"
                    value=""
                    placeholder="Enter your passwords"/>
                    <br/>
                    <button> Log in </button>
                </form>
                <button>Signup</button>
            </div>
        )
    }
}
